$('input[type="checkbox"]').on('change', function() {
  $('input[name="' + this.name + '"]').not(this).prop('checked', false);
  var extra_lose = 0;
  var current_price = 0;
  var current_los = '';
  $('input[type="checkbox"]').each(function( index ) {
    if($(this).prop("checked") == true){
        extra_lose++;
        current_price = $(this).attr('los_price');
        current_los = $(this).val();
    }
  });

  if(extra_lose>0)
  {
    $('.extra_los_rezept').html('<b>TOPPING</b><div class="row"><div class="col-8 topping_name">1x '+ current_los
      +'</div><div class="col-4 text-right topping_preis">'+parseFloat(current_price).toFixed(2).replace('.', ',') + ' €</div></div>');
    $('.cal_price').html((parseFloat($('.all_los_price').val()) + parseFloat(current_price)).toFixed(2).replace('.', ','));
  }
  else
  {
    $('.cal_price').html(parseInt($('.all_los_price').val()).toFixed(2).replace('.', ','));
    $('.extra_los_rezept').html('<b>TOPPING</b><div class="row"><div class="col-12 topping_name">kein optionales Topping-Los ausgewählt</div><div class="topping_preis" hidden></div></div>');
  }
  $('.erg').html(extra_lose);
});

$.fn.losCount = function()
{ var end_count=0;
  $('.backrezept').html('');
  $('.los_count').each(function( index ) {
    if($(this).val()=='')
    {
      $(this).val(0);
    }
    end_count += parseInt($(this).val());
    if(parseInt($(this).val())>0)
    {
      $(this).parent().find('.btn-decrement').prop('disabled', false).removeClass('disabled');
        $('.backrezept').html($('.backrezept').html()+
          '<div class="row"><div class="col-7">'+$(this).val()+'x '+ $(this).parent().parent().find('label.los_name').html()
          +'</div><div class="col-5 text-right">'+($(this).val()*$(this).parent().parent().find('label.los_price').html())
          .toFixed(2).replace('.', ',') + ' €</div></div>');      
    }
    else
    {
      $(this).parent().find('.btn-decrement').prop('disabled', true).addClass('disabled');
    }  
  }); 

  if(end_count<test_count)
  {
    $('.input-group button.btn-increment').prop('disabled', false).removeClass('disabled');
    $('.extra_lose').addClass('disabled');
  }
  if(end_count==test_count)
  {
    $('.input-group button.btn-increment').prop('disabled', true).addClass('disabled');
    $('.extra_lose').removeClass('disabled');       
  }
  return end_count;
}



$.fn.allLosPrice = function(preis)
{ 
  $('.los_count').each(function( index ) {
    if($(this).val()=='')
    {$(this).val(0);}
    preis += parseInt($(this).val())*($(this).parent().parent().find('label.los_price').html());
  });  
  return preis;
}
$.fn.statisticUpdate = function(g_count,preis)
{ 
  $('#gesamt').val(g_count);
  $('.gesamt').html(g_count);
  $('.all_los_price').val(preis);
  $('.cal_price').html(preis.toFixed(2).replace('.', ','));
}

$('.los_count').change(function(event)
{
  event.preventDefault();
  var end_count = 0;
  var preis     = 0;
  var start_count = $('#gesamt').val();
  var change_value=$(this).val();  
  end_count=$(this).losCount();
  if(end_count<=test_count){
    preis=$(this).allLosPrice(preis);  
    $(this).statisticUpdate(end_count,preis);  
  }
  else
  {    
    $('.extra_lose').addClass('disabled');
    var erlaubt=parseInt(test_count)-start_count;
    var dif = parseInt(end_count)-start_count;
    var back_value=parseInt(change_value)-dif;
      alert(change_value+' ist zu groß. Diese Menge wird zurück auf '+ back_value + ' gesetzt');
      $(this).val(back_value);    
      end_count=$(this).losCount();
  }
});

$('.input-group button.btn-increment').on('click touchstart', function( event ) {
  event.preventDefault();
  var los = $(this).parent().parent().find('.los_count');
  if(los.val()=='')
  {
    los.val(0);
  }
  var current_los = los.val(parseInt(los.val())+1);  
  var start_count = $('#gesamt').val();
  var preis= 0;
  var end_count = parseInt(start_count)+1;
  $(this).parent().parent().find('.btn-decrement').prop('disabled', false).removeClass('disabled'); 
  if(end_count==test_count)
  {
    $('.input-group button.btn-increment').prop('disabled', true).addClass('disabled');
    $('.extra_lose').removeClass('disabled');
  }
  if(parseInt(current_los)== test_count)
  {
    $(this).prop('disabled', true).addClass('disabled');
  }  
  preis=$(this).allLosPrice(preis);
  end_count=$(this).losCount();
  $(this).statisticUpdate(end_count,preis);
});

$('.input-group button.btn-decrement').on('click touchstart',function( event ) {
  event.preventDefault(); 
  
  var los         = $(this).parent().parent().find('.los_count');
  var current_los = los.val(parseInt(los.val())-1);   
  var start_count = $('#gesamt').val();
  var preis       = 0;
  var end_count   = parseInt(start_count)-1;


  $(this).parent().parent().find('.btn-increment').prop('disabled', false).removeClass('disabled');
  
  if(parseInt(current_los)== 0)
  {
    $(this).prop('disabled', true).addClass('disabled');
  }
  
  preis=$(this).allLosPrice(preis);
  end_count=$(this).losCount();
  $(this).statisticUpdate(end_count,preis);
  $('.extra_lose').addClass('disabled');
});

