  $( ".zufall a" ).click(function( event ) { 
    event.preventDefault();
    $('.backrezept').html('<b>LOSE</b><br>');
    $(this).addClass('disabled');
    lose=$('.los_count:text');
    lose_n=$('.los_count[type="number"');
    var g_count = 0;      
    var preis   = 0;
    var typ=lose.length;
    // Auswahl zurücksetzen
    lose.each(function( index ) {
      $(this).val(0);
      $(this).parent().find('.btn-decrement').prop('disabled', true).addClass('disabled');
      $(this).parent().find('.btn-increment').prop('disabled', false).removeClass('disabled');
    })
    lose_n.each(function( index ) {
      $(this).val(0);
      $(this).parent().find('.btn-decrement').prop('disabled', true).addClass('disabled');
      $(this).parent().find('.btn-increment').prop('disabled', false).removeClass('disabled');
    })
    var t_count=0;
    var max_count= test_count;
    while (g_count < test_count && t_count<lose.length) {
      l_index = Math.floor((Math.random() * typ)); 
      var random = 0;
      if(lose.eq( l_index ).val()==0)
      {

          t_count++;
          if(t_count<lose.length)
          {
            random = Math.floor((Math.random() * max_count) + 1);
          }
          else
          {
            random = max_count;
          }

          lose.eq( l_index ).parent().find('.btn-decrement').prop('disabled', false).removeClass('disabled');
          lose.eq( l_index ).val(random);
          lose_n.eq( l_index ).val(random);
          preis += parseInt(random*lose.eq( l_index ).parent().parent().find('label.los_price').html());
          //$('.backrezept').html($('.backrezept').html()+random+'x '+ lose.eq( l_index ).parent().parent().find('label.los_name').html()+' ['+lose.eq( l_index ).parent().parent().find('label.los_price').html() + ' €]<br>');        
          $('.backrezept').html($('.backrezept').html()+
          '<div class="row"><div class="col-7">'+random+'x '+ lose.eq( l_index ).parent().parent().find('label.los_name').html()
          +'</div><div class="col-5 text-right">'+(random*lose.eq( l_index ).parent().parent().find('label.los_price').html()).toFixed(2).replace('.', ',') + ' €</div></div>');          
         g_count += random;
         max_count -= random;
      }
    } 
    $(this).removeClass('disabled');
    $('#gesamt').val(g_count);
    $('.gesamt').html(g_count);
    $('.all_los_price').val(preis);
    $('.cal_price').html(preis.toFixed(2).replace('.', ','));
    $('.slide_text .btn-increment').prop('disabled', true).addClass('disabled');
    $('.extra_lose').removeClass('disabled');

  });
